import styled from "styled-components";
export const Header = styled.nav`
  background-color: black;
  color: #fff;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 16px;
  height: 70px;
  border: none;
  border-radius: 40px;
  animation: 0.5s;
  transition: 0.5s;
`;
